private static String numberOfCalls(Integer count) {
        JSONObject jsonObject = new JSONObject();
        //系统业务量 xtywl
        JSONObject jsonObject1 = new JSONObject();
        jsonObject1.put("ywcdl", count);
        //主量纲
        jsonObject.put("ZLG", jsonObject1);
        return jsonObject.toString();
    }解析代码

